import React from "react";

const App = () => {
  function CountDisplay() {
    const count = 0;
    return <div>The count is : {count}</div>;
  }
  function Countter() {
    const setCount = () => {};
    const increment = () => setCount((c) => c + 1);
  }
  return <div></div>;
};

export default App;
